import React, { useEffect, useState } from 'react';
import axios from 'axios';

function ProductList() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/products')
      .then(response => setProducts(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h2>Lista Produktów</h2>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Nazwa</th>
            <th>Opis</th>
            <th>Cena</th>
            <th>Stan</th>
          </tr>
        </thead>
        <tbody>
          {products.map(product => (
            <tr key={product.produkt_id}>
              <td data-label="ID">{product.produkt_id}</td>
              <td data-label="Nazwa">{product.name}</td>
              <td data-label="Opis">{product.description}</td>
              <td data-label="Cena">{product.price} zł</td>
              <td data-label="Stan">{product.stock}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ProductList;
